import React, { useState, useEffect } from 'react';

function ExerciseJournal() {
    const [entries, setEntries] = useState(Array.from({ length: 20 }, () => ({ exercise: '', sets: '', reps: '', ampm: '', favorite: false })));
    const [exerciseList, setExerciseList] = useState([]);

    useEffect(() => {
        fetchExerciseList();
    }, []);

    const fetchExerciseList = async () => {
        try {
            const response = await fetch('https://work-out-api1.p.rapidapi.com/search', {
                method: 'GET',
                headers: {
                    'X-RapidAPI-Key': '53b8ecad31mshd3ead90d923490bp17852ajsnb678a1515e7c',
                    'X-RapidAPI-Host': 'work-out-api1.p.rapidapi.com'
                }
            });

            if (!response.ok) {
                throw new Error('Failed to fetch exercise data');
            }

            const data = await response.json();
            setExerciseList(data.exercises);
        } catch (error) {
            console.error('Error fetching exercise data:', error.message);
        }
    };

    const handleEntryChange = (index, event) => {
        const { name, value } = event.target;
        const newEntries = [...entries];
        newEntries[index] = { ...newEntries[index], [name]: value };
        setEntries(newEntries);
    };

    const filterExerciseList = (inputValue) => {
        return exerciseList.filter(exercise => exercise.name.toLowerCase().includes(inputValue.toLowerCase()));
    };

    const handleSubmitEntry = (index) => {
        // Here you can handle the logic for submitting the entry, for example, sending it to a server
        console.log("Submitting entry at index:", index);
    };

    const handleRemoveEntry = (index) => {
        // Here you can handle the logic for removing the entry, for example, removing it from the state
        const newEntries = [...entries];
        newEntries.splice(index, 1);
        setEntries(newEntries);
    };

    return (
        <div style={{ maxWidth: '650px' }}>
            <h5>Exercise Journal</h5>
            <div style={{ maxHeight: '400px', overflowY: 'auto' }}>
                <table style={{ width: '100%', borderCollapse: 'collapse', borderSpacing: '0' }}>
                    <thead>
                        <tr>
                            <th style={{ padding: '5px' }}>Exercise</th>
                            <th style={{ padding: '5px' }}>Sets</th>
                            <th style={{ padding: '5px' }}>Reps</th>
                            <th style={{ padding: '5px' }}>AM/PM</th>
                            <th style={{ padding: '5px' }}>Fav</th>
                            <th style={{ padding: '5px' }}>Submit</th>
                            <th style={{ padding: '5px' }}>Remove</th>
                        </tr>
                    </thead>
                    <tbody>
                        {entries.map((entry, index) => (
                            <tr key={index}>
                                <td style={{ padding: '5px' }}>
                                    <input
                                        type="text"
                                        name="exercise"
                                        value={entry.exercise}
                                        onChange={(event) => handleEntryChange(index, event)}
                                        list="exerciseList"
                                    />
                                    <datalist id="exerciseList">
                                        {exerciseList && filterExerciseList(entry.exercise).map((exercise, i) => (
                                            <option key={i} value={exercise.name} />
                                        ))}
                                    </datalist>
                                </td>
                                <td style={{ padding: '5px' }}>
                                    <input
                                        type="text"
                                        name="sets"
                                        value={entry.sets}
                                        onChange={(event) => handleEntryChange(index, event)}
                                    />
                                </td>
                                <td style={{ padding: '5px' }}>
                                    <input
                                        type="text"
                                        name="reps"
                                        value={entry.reps}
                                        onChange={(event) => handleEntryChange(index, event)}
                                    />
                                </td>
                                <td style={{ padding: '5px' }}>
                                    <select
                                        name="ampm"
                                        value={entry.ampm}
                                        onChange={(event) => handleEntryChange(index, event)}
                                    >
                                        <option value="AM">AM</option>
                                        <option value="PM">PM</option>
                                    </select>
                                </td>
                                <td style={{ padding: '5px' }}>
                                    <input
                                        type="checkbox"
                                        name="favorite"
                                        checked={entry.favorite}
                                        onChange={(event) => handleEntryChange(index, event)}
                                    />
                                </td>
                                <td style={{ padding: '5px' }}>
                                    <button onClick={() => handleSubmitEntry(index)}>Submit</button>
                                </td>
                                <td style={{ padding: '5px' }}>
                                    <button onClick={() => handleRemoveEntry(index)}>Remove</button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
}

export default ExerciseJournal;
